  false,\n\t\"url\": null,\n\t\"notes\": \"In this paper we describe the locations
  of several known moose calving areas on the Kenai National Moose Range, the features
  and vegetation in the Moose-Chickaloon River calving area, moose numbers, productivity,
  and birth period observed in these calving areas between 1957 and 1971, and attempt
  to estimate the numbers of cows and proportion of the region's cow population utilizing
  this calving area in 1978 and 1979. Paper to be published in Proceedings of 16th
  North American Moose Conference and Workshop, Prince Albert, Canada.\",\n\t\"license_title\":
